import React, { useState } from 'react';
import Button from './components/Button';
import defaultFunction, { multiplyNumbers } from './util';
import './App.css';

function App() {
  const [count] = useState(0);


  return (
    <div>
      <span className="counter"> {count} </span>
      <br /><br />
      <span>{defaultFunction(1, 2)}</span>
      <br />
      <span>2 * 3 is {multiplyNumbers(2, 3)}</span>
      <Button />



    </div>
  );
}

export default App;
